import React, { useState } from 'react';
// import './styles/StudentRegister.css';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';


function StudentRegister() {
  const [formData, setFormData] = useState({
    studentname: '',
    rollNo: '',
    branch: '',
    section: '',
    semester: '',
    phoneNumber: '',
    personalEmail: '',
    officialEmail: '',
    parentName: '',
    parentPhoneNumber: '',
    parentEmail: '',
    password: '',
    confirmPassword: '',
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // You can submit the form data to a server, store it in a database, or perform any other necessary action here.
    console.log(formData);

    // if (!studentname || !rollNo || !branch ||!section ||!semester ||!phoneNumber 
    //   || !personalEmail || !officialEMail ||!parentName ||!parentEmail || 
    //   !password || !confrimPassword ) {
    //   setErrorMessage('Please fill in all fields');
    //   return;

    
    if (!formData){
      setErrorMessage('Please fill in all fields');
      return;
    }
  

  const newStudentRegister = {
    studenttname, rollNo, branch, section, semester, phoneNumber, personalEmail, officialEmail,
    parentName, parentPhoneNumber, parentEmail, password, confirmPassword,
  };



  axios
      .post('http://localhost:3000/StudentRegisters_db', newStudentRegister)
      .then((response) => {
        console.log(response.data);
        setFormData('');

      })
      .catch((error) => {
        console.log(error);
        setErrorMessage('An error occurred. Please try again later.');
      });
  };

  const styles = {
    formContainer: {
      maxWidth: '400px',
      margin: '0 auto',
      padding: '20px',
      border: '1px solid #ccc',
      borderRadius: '5px',
      boxShadow: '0 0 5px rgba(0, 0, 0, 0.2)',
    },
    heading: {
      textAlign: 'center',
      marginBottom: '20px',
    },
    label: {
      display: 'block',
      marginBottom: '10px',
      fontWeight: 'bold',
    },
    input: {
      width: '100%',
      padding: '10px',
      marginBottom: '20px',
      border: '1px solid #ccc',
      borderRadius: '4px',
    },
    select: {
      width: '100%',
      padding: '10px',
      marginBottom: '20px',
      border: '1px solid #ccc',
      borderRadius: '4px',
    },
    button: {
      backgroundColor: '#007bff',
      color: '#fff',
      border: 'none',
      padding: '10px 20px',
      borderRadius: '4px',
      cursor: 'pointer',
    },
    formGroup: {
      marginBottom: '20px',
    },
  };



  return (
    <div style={styles.formContainer}>
      <h2 style={styles.heading}>Student Registration</h2>
      <form onSubmit={handleSubmit}>
        <div style={styles.formGroup}>
          <label style={styles.label}>
            Name:
            <input type="text" name="name" onChange={handleInputChange} style={styles.input} required/>
          </label>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>
            Roll No:
            <input type="text" name="rollNo" onChange={handleInputChange} style={styles.input} required/>
          </label>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>
            Branch:
            <select name="branch" onChange={handleInputChange} value={formData.branch} style={styles.select} required>
              <option value="">Select Branch</option>
              <option value="cse">CSE</option>
              <option value="it">IT</option>
              <option value="mech">Mechanical</option>
              <option value="eee">EEE</option>
              <option value="ece">ECE</option>
              <option value="civil">Civil</option>
              <option value="cse-aiml">CSE - AIML</option>
              <option value="cse(iotcsbc)">CSE (IoT & CSBC)</option>
              <option value="ai&ds">AI & DS</option>
              <option value="chemical">Chemical</option>
              <option value="bio-tech">Bio-Tech</option>
            </select>
          </label>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>
            Section:
            <input type="text" name="section" onChange={handleInputChange} style={styles.input} required/>
          </label>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>
            Semester:
            <select name="semester" onChange={handleInputChange} value={formData.semester} style={styles.select} required>
              <option value="">Select Semester</option>
              <option value="i">I</option>
              <option value="ii">II</option>
              <option value="iii">III</option>
              <option value="iv">IV</option>
              <option value="v">V</option>
              <option value="vi">VI</option>
              <option value="vii">VII</option>
              <option value="viii">VIII</option>
            </select>
          </label>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>
            Phone Number:
            <input type="text" name="phoneNumber" onChange={handleInputChange} style={styles.input} required />
          </label>
        </div>


        <div style={styles.formGroup}>
          <label style={styles.label}>
            Personal Email:
            <input type="email" name="personalEmail" onChange={handleInputChange} style={styles.input} required/>
          </label>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>
            Official Email:
            <input type="email" name="officialEmail" onChange={handleInputChange} style={styles.input} required/>
          </label>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>
            Parent Name:
            <input type="text" name="parentName" onChange={handleInputChange} style={styles.input} required/>
          </label>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>
            Parent Phone Number:
            <input type="text" name="parentPhoneNumber" onChange={handleInputChange} style={styles.input} required/>
          </label>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>
            Parent Email:
            <input type="email" name="parentEmail" onChange={handleInputChange} style={styles.input} required />
          </label>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>
            Password:
            <input type="password" name="password" onChange={handleInputChange} style={styles.input} required />
          </label>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>
            Confirm Password:
            <input type="password" name="confirmPassword" onChange={handleInputChange} style={styles.input} required/>
          </label>
        </div>

        <button type="submit" style={styles.button}>Submit</button>

      </form>
    </div>
  );
}

export default StudentRegister;
